script: |
  super -f text -I q5049.spq | sort > q5049.out

inputs:
  - name: q5049.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 46 * - col2 * col0 * + col0 * - - 91 BETWEEN ( col2 + col0 ) AND col1 * col0 + col2;
  - name: tab2

outputs:
  - name: q5049.out
    data: |
      46	51	23
      64	77	40
      75	67	58
